// react
import React, { Component, Fragment } from "react";

// third part
import { Route, Switch, Redirect } from "react-router-dom";

import SignIn from "./components/LoginForm/signInForm";
import Admin from "./components/Admin/adminBoard";
import Employee from "./components/Employee/employeeBoard";
import Register from "./components/RegisterForm/signUpForm";

export default class App extends Component {
  render() {
    return (
      <Fragment>
        <Switch>
          <Route path="/admin" component={Admin} />
          <Route path="/employee" component={Employee} />
          <Route path="/register" component={Register} />
          <Route path="/signin" component={SignIn} />
          <Redirect from="/" to="/signin" />
        </Switch>
      </Fragment>
    );
  }
}
